import React from "react";
import Card from "./Card";
import "./Projects.css";
import UsedTech from "./UsedTech";
import { v4 as uuidv4 } from 'uuid';

const Projects = ({projectRef}) => {
  const projects = [
    {
      projectName:"Blinkit",
      imgUrl:
        "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSnkMs-o0s2dN3nnlfn1qvpDqtednXGZoS3avQe9ckUVuPmz669lxvn631nwKCt8Xy4GqU&usqp=CAU",
      codeUrl: "https://github.com/Imaryan08/blinkit.git",
      websiteUrl: "https://blinkit.netlify.app/",
      aboute: "Blinkit is an Indian instant delivery service. It was founded<br /> in December 2013 and is based out of Gurgaon. Customers of<br /> the company use a mobile application to order groceries<br /> and essentials online. Blinkit's employees then secure the items from their warehouse and deliver the items to the consumer within 10 minutes.",
      tech: ["Javascript", "HTML 5", "CSS 3" , "MongoDb"],
    },
    {
      projectName:"Shopper Stop",
      imgUrl:
        "https://www.retail4growth.com/public/uploads/editor/2019-07-31/1564548758.jpg",
      codeUrl: "https://github.com/Ashokzarmariya/team-shoppersstop",
      websiteUrl: "https://team-shoppersstop.vercel.app/",
      aboute: "shopperstop is An eCommerce website for lifestyle products. we have add feture like product sorting, Product categorization based on colour, gender, price, brand, etc. Add to cart feature",
      tech: ["Javascript", "HTML 5", "CSS 3"],
    },
  ];

  return (
    <div className="container" >
      <div className="project">
        <h1 ref={projectRef} className="d-flex justify-content-center">Projects</h1>
      </div>
      <div className="my-3">
        <div className="my-0 d-flex justify-content-center flex-wrap">
          {projects.map((item) => {
            let stack = item.tech;

            return (
              <Card 
                key={uuidv4()}
                projectName={item.projectName}
                imageUrl={item.imgUrl}
                codeUrl={item.codeUrl}
                websiteUrl={item.websiteUrl}
                about={item.aboute}
                usedTech={stack.map((tech) => {
                  return <UsedTech key={uuidv4()} techStack={tech} />;
                })}
              />
            );
          })}
        </div>
      </div>
    </div>
  );
};

export default Projects;
